Hai haiii #temanpemilih, PPS Desa Suroyudan mengucapkan selamat Tahun Baru Islam 1 Muharam 1446 H. Tahun Baru Hijriah atau Tahun Baru Islam merupakan suatu hari yang penting bagi umat Islam karena menandai peristiwa penting yang terjadi dalam sejarah Islam yaitu memperingati penghijrahan Nabi Muhammad SAW dari Kota Makkah ke Madinah pada tahun 622 Masehi. Semoga tahun ini penuh keberkahan, keselamatan dan kebahagiaan bagi kita semua..

